import PropTypes from 'prop-types';
import HOC from "../../components/HOCImagePort/HOCImagePort"


class ImagePort extends React.Component {

  constructor(props) {
    super(props);

  }


  render() {
    return (
     <>

      {props.isScalable?

          <img  
          src={props.src}
          width = {props.width}
          height = {props.height}  
            />
    :
            <img  
            src={props.src}
            width = {props.width}
            height = {props.height}  
        />
    }





     </>)}};



